import React from 'react';
import {Image} from 'semantic-ui-react';

const Member = () => {
    return (
        <div className="chat-container member border">
          <div>
          <Image src='https://react.semantic-ui.com/images/wireframe/square-image.png' avatar size='tiny' circular />
          </div>
      </div>
    )
}

export default Member;
